Optional<StringView> get_locale_language_mapping(StringView locale, StringView language)
{
    auto locale_value = locale_from_string(locale);
    if (!locale_value.has_value())
        return {};

    auto language_value = language_from_string(language);
    if (!language_value.has_value())
        return {};

    auto locale_index = to_underlying(*locale_value) - 1; // Subtract 1 because 0 == Locale::None.
    auto language_index = to_underlying(*language_value);

    auto mapping_index = s_languages.at(locale_index);
    auto const& mappings = s_language_lists.at(mapping_index);

    auto language_string_index = mappings.at(language_index);
    auto language_mapping = s_string_list.at(language_string_index);

    if (language_mapping.is_empty())
        return {};
    return language_mapping;
}

