Optional<StringView> get_locale_territory_mapping(StringView locale, StringView territory)
{
    auto locale_value = locale_from_string(locale);
    if (!locale_value.has_value())
        return {};

    auto territory_value = territory_from_string(territory);
    if (!territory_value.has_value())
        return {};

    auto locale_index = to_underlying(*locale_value) - 1; // Subtract 1 because 0 == Locale::None.
    auto territory_index = to_underlying(*territory_value);

    auto mapping_index = s_territories.at(locale_index);
    auto const& mappings = s_territory_lists.at(mapping_index);

    auto territory_string_index = mappings.at(territory_index);
    auto territory_mapping = s_string_list.at(territory_string_index);

    if (territory_mapping.is_empty())
        return {};
    return territory_mapping;
}

