Optional<StringView> get_locale_script_mapping(StringView locale, StringView script)
{
    auto locale_value = locale_from_string(locale);
    if (!locale_value.has_value())
        return {};

    auto script_value = script_tag_from_string(script);
    if (!script_value.has_value())
        return {};

    auto locale_index = to_underlying(*locale_value) - 1; // Subtract 1 because 0 == Locale::None.
    auto script_index = to_underlying(*script_value);

    auto mapping_index = s_scripts.at(locale_index);
    auto const& mappings = s_script_lists.at(mapping_index);

    auto script_string_index = mappings.at(script_index);
    auto script_mapping = s_string_list.at(script_string_index);

    if (script_mapping.is_empty())
        return {};
    return script_mapping;
}

