Optional<StringView> get_locale_long_currency_mapping(StringView locale, StringView long_currency)
{
    auto locale_value = locale_from_string(locale);
    if (!locale_value.has_value())
        return {};

    auto long_currency_value = currency_from_string(long_currency);
    if (!long_currency_value.has_value())
        return {};

    auto locale_index = to_underlying(*locale_value) - 1; // Subtract 1 because 0 == Locale::None.
    auto long_currency_index = to_underlying(*long_currency_value);

    auto mapping_index = s_long_currencies.at(locale_index);
    auto const& mappings = s_currency_lists.at(mapping_index);

    auto long_currency_string_index = mappings.at(long_currency_index);
    auto long_currency_mapping = s_string_list.at(long_currency_string_index);

    if (long_currency_mapping.is_empty())
        return {};
    return long_currency_mapping;
}

